    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awFileUploadRenderFunction",
            "deps": "js/AwFileUploadService",
            "options": {
                "useAria": true,
                "elementRefList": [
                    "providerPopupRef",
                    "customViewPopupRef"
                ]
            }
        },
        "providerPopup": {
            "actionType": "popup",
            "inputData": {
                "options": {
                    "placement": "bottom-start",
                    "toggleMode": true
                }
            }
        },
        "customViewPopup": {
            "actionType": "popup",
            "inputData": {
                "options": {
                    "draggable": true,
                    "whenParentScrolls": "close",
                    "resizeToClose": true,
                    "autoFocus": true,
                    "forceCloseOthers": false,
                    "hasArrow": false,
                    "hasCloseButton": true,
                    "placement": "left",
                    "view": "",
                    "height": "315",
                    "width": "550"
                }
            }
        },
        "handleViewFileSelection": {
            "actionType": "JSFunction",
            "method": "handleViewFileSelection",
            "inputData": {
                "prop": "{{props}}",
                "data": "{{data}}"
            },
            "deps": "js/AwFileUploadService"
        }
    },
    "data": {
        "fileChosen": {
            "now": false,
            "uploadModelProviderSelected": false,
            "_attachedFiles": null
        },
        "isDragOn": false
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render",
        "onUpdate": [
            {
                "action": "handleViewFileSelection",
                "observers": [
                    "props.selectionData"
                ]
            }
        ]
    },
    "i18n": {
        "ChooseFile": [
            "UIMessages"
        ],
        "NoFileChosen": [
            "UIMessages"
        ],
        "singleUpload": [
            "UIMessages"
        ],
        "multipleUpload": [
            "UIMessages"
        ]
    },
    "props": {
        "type-filter": {
            "type": "string"
        },
        "form-data": {
            "type": "object"
        },
        "file-change-action": {
            "type": "action"
        },
        "is-required": {
            "type": "object"
        },
        "multiple": {
            "type": "boolean"
        },
        "remove-tooltip": {
            "type": "string"
        },
        "choose-file-name": {
            "type": "string"
        },
        "upload-model": {
            "type": "object"
